import React from 'react'
import {withOktaAuth} from "@okta/okta-react";
import User from "../Cards/User";


export default withOktaAuth(class Admin extends React.Component{

    state = {
        users: null
    }


    componentDidMount() {
        this.fetchUsers()
    }

    fetchUsers = () => {
        const packet = {
            method: "GET",
            headers: {
                'Content-Type': "application/json",
                'Accept': "application/json",
            },
        }
        fetch("https://www.bengarlock.com:8080/oktausers/", packet)
            .then(res => res.json())
            .then(users => this.setState({users: users}))
    }

    renderUsers = () => {
        return this.state.users.map(user => <User key={user.id} user={user}/>)
    }





    render() {

        return(
            <div>
                <h3>User Administration</h3>
                <table>
                    <thead>

                    </thead>
                    <tbody>
                        {this.state.users ? this.renderUsers() : null}
                    </tbody>

                </table>
            </div>


        )
    }
})
